import ReactSpinner from 'react-bootstrap/Spinner';
const Spinner = () => {
  return (
    <div>
      <ReactSpinner animation='border' role='status' sizw='md'>
        <span className='sr-only'>Loading...</span>
      </ReactSpinner>
    </div>
  );
};

export default Spinner;
